import React from "react";
import "./BillFrom.css";

function BillFrom() {
  return (
    <React.Fragment>
      <p className="bill-from">Bill From</p>
      <div className="input-container">
        <label htmlFor="street-address" className="street">
          Street Address
        </label>
        <input type="text" name="street-address" className="street-input" />
        <div className="city-zip-container">
          <label htmlFor="city">City</label>
          <input type="text" name="city" />
          <label htmlFor="zip">Zip Code</label>
          <input type="text" name="zip" />
        </div>
      </div>
    </React.Fragment>
  );
}

export default BillFrom;
